import React from "react";

import { NavLink } from "react-router-dom";

const Common = (props) => {
  return (
    <>
      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 order-2 order-lg-1 d-flex flex-column justify-content-center align-items-start">
                  <h1>
                    {props.name}
                    <strong className="brand-name"> Rohit Soni</strong>
                  </h1>
                  <h2 className="my-3">
                    We are the team of Web Developers who makes websites
                  </h2>
                  <div className="mt-3">
                    <NavLink to={props.visit} className="btn btn-primary started">
                      {props.btnName}
                    </NavLink>
                  </div>
                </div>
                <div className="col-lg-6 order-1 order-lg-2 header-img">
                  <img src={props.imgSrc} className="img-fluid animated" alt="home-img" />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Common;
